"use strict";const listLink=document.querySelectorAll(".list__link"),btnSearch=document.querySelector(".btn__search path"),btnButtom=document.querySelector(".btn__buttom"),attributeSvg=btnSearch.getAttribute("stroke"),audio=new Audio("audio/click.mp3");for(let t of listLink)t.addEventListener("mouseover",(()=>{t.style.color="#cda274",t.style.transform="translateY(-0.2rem)"})),t.addEventListener("mouseout",(()=>{t.style.color="",t.style.transform=""}));btnButtom.addEventListener("click",(()=>{btnButtom.classList.add(audio.play())})),btnButtom.addEventListener("mouseover",(()=>{btnSearch.setAttribute("stroke","#cda274"),btnButtom.style.transform="translateY(-0.2rem)"})),btnButtom.addEventListener("mouseout",(()=>{btnSearch.setAttribute("stroke","#141414"),btnButtom.style.transform=""}));